    private static string SquareString(CellState? cellState)
    {
        return cellState switch
        {
            CellState.Empty => "&nbsp;",
            CellState.O => "💣",
            CellState.S => "🚢",
            CellState.X => "❌",
            _ => "-"
            };
    }

